import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

const logoBase64 = "data:image/png;base64,";

const datosFactura = {
  tienda: {
    nombre: "Factura - Sublinet",
    direccion: "Av. Central 123, Managua",
    Domicilio_Fiscal: "Centro de Inversiones de Sublinet",
    telefono: "+505 8888-0000",
    correo: "sublinetoffcialmail@sublinet.com",
  },
  cliente: {
    nombre: "Pancho Morales",
    direccion: "Sutiaba, Casa #35",
    telefono: "+505 7777-7777",
  },
  factura: {
    numero: "F-2025-00123",
    fecha: "15/11/2025",
    metodoPago: "Tarjeta de Crdito",
  },
  productos: [
    { id: 1, name: "Camisa Azul", category: "Ropa", quantity: 25, price: 20 },
    { id: 2, name: "Camisa Blanca", category: "Ropa", quantity: 40, price: 18 },
    { id: 3, name: "Camisa Negra", category: "Ropa", quantity: 30, price: 22 },
    { id: 4, name: "Camisa Roja", category: "Ropa", quantity: 15, price: 19 },
  ],
};

export const generarPDF = () => {
    const doc = new jsPDF();

    // Logo
    doc.addImage(logoBase64, "PNG", 150, 10, 40, 40);

    // Encabezado tienda
    doc.setFontSize(18);
    doc.text(datosFactura.tienda.nombre, 20, 20);
    doc.setFontSize(11);
    doc.text(`Direccin: ${datosFactura.tienda.direccion}`, 20, 28);
    doc.text(`Domicilio fiscal: ${datosFactura.tienda.Domicilio_Fiscal}`, 20, 34);
    doc.text(`Email: ${datosFactura.tienda.correo}`, 20, 40);

    // Datos cliente
    doc.setFontSize(14);
    doc.text("Datos del Cliente", 20, 55);
    doc.setFontSize(11);
    doc.text(`Nombre: ${datosFactura.cliente.nombre}`, 20, 63);
    doc.text(`Direccin: ${datosFactura.cliente.direccion}`, 20, 69);
    doc.text(`Telfono: ${datosFactura.cliente.telefono}`, 20, 75);

    // Detalles de factura
    doc.setFontSize(14);
    doc.text("Detalles de Factura", 130, 55);
    doc.setFontSize(11);
    doc.text(`Factura N: ${datosFactura.factura.numero}`, 130, 63);
    doc.text(`Fecha: ${datosFactura.factura.fecha}`, 130, 69);
    doc.text(`Mtodo de pago: ${datosFactura.factura.metodoPago}`, 130, 75);

    // Tabla de productos usando autoTable
    const filas = datosFactura.productos.map((p) => [
      p.name,
      p.quantity,
      `$${p.price}`,
      `$${p.quantity * p.price}`,
    ]);

    autoTable(doc, {
      startY: 90,
      head: [["Descripcin", "Cant.", "Precio Unitario", "Subtotal"]],
      body: filas,
    });

    // Total
    const total = datosFactura.productos.reduce(
      (acc, p) => acc + p.quantity * p.price,
      0
    );

    const finalY = doc.lastAutoTable.finalY + 10;
    doc.setFontSize(14);
    doc.text(`TOTAL: $${total}`, 20, finalY);

    doc.save("factura_Sublinet.pdf");
  };